    items()
  }, [])

  // Fetched items
  const items = async () => {
    const res = await fetch(`https://fakestoreapi.com/products/2`)
    const data = await res.json()

    setProducts(data)
  } 

return (
  <div className="boxes">
    <div key={products.id} className="box">
            <img src={`${products.image }`} alt="" className="img" />
    </div>
    <div key={products.id} className="box">
            <img src={`${products.image }`} alt="" className="img" />
    </div>
    <div key={products.id} className="box">
      <img src={`${products.image }`} alt="" className="img" />
      <p>{products.id}</p>
    </div>
  </div>
  )
}

export default ProductsList
